            <button className="btn btn-primary">Get started</button>
          </div>
        </div>
      </div>
      <div className="footer-bottom container">
        <div className="d-flex align-items-center justify-content-between inner">
          <p className="mb-0">Copyright Â© Hela 2020</p>
